import React from "react";
import Active from "../../assets/logo-search-grid-1x.png";
import Inactive from "../../assets/icons8-heart.gif";


function ToggleLike({ active, handleChangeActive }) {
  return (
    <>
      <h1>Toggle images</h1>
      <div className="toggle-wrapper">
        {active ? (
          <img
            className="active"
            src={Active}
            alt="yellow star"
            onClick={() => handleChangeActive()}
          />
        ) : (
          <img
            className="inactive"
            src={Inactive}
            alt="black and white star"
            onClick={() => handleChangeActive()}
          />
        )}
      </div>
    </>
  );
}

export default ToggleLike;
